--
-- Table structure for table `member_apartment_ledger`
--

CREATE TABLE IF NOT EXISTS `member_apartment_ledger` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `accountant_id` int(11) NOT NULL COMMENT 'added by the accountant',
  `member_id` int(11) NOT NULL COMMENT 'member relation',
  `appartment_id` int(11) NOT NULL COMMENT 'plot details',
  `date_as_on` varchar(45) DEFAULT NULL,
  `particulars` varchar(500) DEFAULT NULL,
  `society_receipt` varchar(200) DEFAULT NULL,
  `payable_outstanding` varchar(200) DEFAULT NULL,
  `payment_received` varchar(200) DEFAULT NULL,
  `balance_outstanding` varchar(200) DEFAULT NULL,
  `remarks` varchar(300) DEFAULT NULL,
  `last_modified` datetime DEFAULT NULL,
  `timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `appartment_id_fk` (`appartment_id`),
  KEY `accountant_id_fk` (`accountant_id`),
  KEY `member_id_fk` (`member_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

