--
-- Table structure for table `member_appartments`
--

CREATE TABLE IF NOT EXISTS `member_appartments` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) NOT NULL,
  `accountant_id` int(11) NOT NULL,
  `unit_no` varchar(45) DEFAULT NULL,
  `unit_type` varchar(45) NOT NULL,
  `block` varchar(45) DEFAULT NULL,
  `floor` varchar(45) DEFAULT NULL,
  `prize` varchar(45) DEFAULT NULL,
  `apartment_document` varchar(200) NOT NULL,
  `last_update` datetime DEFAULT NULL,
  `timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `status` int(11) NOT NULL,
  `created_by` int(11) NOT NULL,
  `photo_path` varchar(256) NOT NULL,
  `date` date NOT NULL,
  `installment_plan_id` int(11) NOT NULL,
  `plan_type` int(11) NOT NULL,
  `plan_payment_type` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unit_no` (`unit_no`),
  KEY `accountant_id` (`accountant_id`),
  KEY `member_id` (`member_id`),
  KEY `fk_member_appartments_installment_plan1_idx` (`installment_plan_id`)
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=46 ;

